import React from 'react'

const Tile = ({tile}) => {
    let classArray=['tile']
    classArray.push('tile'+tile.value)
    if(!tile.mergedInto){
        classArray.push(`position_${tile.row}_${tile.column}`)
    }
    if(tile.mergedInto){
        classArray.push('merged')
    }
    if(tile.isNew()){
        classArray.push('new')
    }
  return (
    <div>Tile</div>
  )
}

export default Tile
